  false,\n\t\"url\": null,\n\t\"notes\": \"This hunt plan initiates the effort to
  reduce the Parker River National Wildlife Refugeu2019s white-tailed deer herd numbers
  to a level compatible with the habitat's carrying capacity. This action will provide
  a recreational opportunity for the hunting public to harvest surplus animals. As
  the deer numbers are lowered, the potential threat to public and employee health
  and safety from Lyme disease should diminish. This hunt is compatible with the wildlife
  management objectives of the refuge, and should cause minimum conflict with existing
  non-consumptive uses. The implementation of a deer hunt on portions of the refuge
  will increase the recreational opportunities Essex County area. Currently the refuge
  provides access for bird-watching, beach activities, fishing, hiking on trails,
  bicycling, guided tour groups, and educational activities.\",\n\t\"license_title\":
